import Header from './Header';
import Profile from './Profile';
import OverView from './OverView';
import Design from './Design';
import Explain from './Explain';


import './App.css';


function App() {


  return (
    <div className="App">
      <Header></Header>
      <Profile></Profile>
      <OverView></OverView>
      <Design></Design>
      <Explain></Explain>

    </div>
  );
}

export default App;
